contracts/2_monthStore.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

contract MonthStore {
    mapping(uint => string) months;
    uint count = 0;
    function addMonth(string memory _monthName) public {
        count = count + 1;
        months[count] = _monthName;
    }
}

